webpackJsonp([0x63e9f0752599],{3031:function(e,o){e.exports={pathContext:{docHtml:'<h1>path-key <a href="https://travis-ci.org/sindresorhus/path-key"><img src="https://travis-ci.org/sindresorhus/path-key.svg?branch=master" alt="Build Status"></a></h1>\n<blockquote>\n<p>Get the <a href="https://en.wikipedia.org/wiki/PATH_(variable)">PATH</a> environment variable key cross-platform</p>\n</blockquote>\n<p>It\'s usually <code>PATH</code>, but on Windows it can be any casing like <code>Path</code>...</p>\n<h2>Install</h2>\n<pre><code>$ npm install --save path-key\n</code></pre>\n<h2>Usage</h2>\n<pre><code class="language-js">const pathKey = require(\'path-key\');\n\nconst key = pathKey();\n//=> \'PATH\'\n\nconst PATH = process.env[key];\n//=> \'/usr/local/bin:/usr/bin:/bin\'\n</code></pre>\n<h2>API</h2>\n<h3>pathKey([options])</h3>\n<h4>options</h4>\n<h5>env</h5>\n<p>Type: <code>Object</code><br>\nDefault: <a href="https://nodejs.org/api/process.html#process_process_env"><code>process.env</code></a></p>\n<p>Use a custom environment variables object.</p>\n<h4>platform</h4>\n<p>Type: <code>string</code><br>\nDefault: <a href="https://nodejs.org/api/process.html#process_process_platform"><code>process.platform</code></a></p>\n<p>Get the PATH key for a specific platform.</p>\n<h2>License</h2>\n<p>MIT Â© <a href="https://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/path-key/readme",proj:"argo-ci"}}}});
